import React from "react";
import "./Profil.css";

const Profil = () => {
  return (
    <div>
      <h1>Davor Pernjek</h1>
      <h3>Rezultati provjera</h3>
      <ul>
        <li>Naziv provjere: 17 bodova</li>
        <li>Naziv provjere 2: 87 bodova</li>
        <li>Naziv provjere 3: 54 bodova</li>
        <li>Naziv provjere 4: 12 bodova</li>
      </ul>
    </div>
  );
};

export default Profil;
